import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#003f73',
        justifyContent: "center",
        alignItems: "center",
    },

    containerLogo: {
        flex: 1,
        justifyContent: "center",
    },
    
    container2: {
        backgroundColor: '#003f73',
        width: '90%',
        flex: 1,
        borderRadius: 7,
        padding: 0,

    },

    input: {
        width: '90%',
        backgroundColor: 'white',
        borderRadius: 3,
        margin: 10,
        padding: 10,
    },

    textoBotao: {
        color: 'white',
        fontSize: 15,
        padding: 5,
        textAlign: "center"
    },

    textLink: {
        fontSize: 10,
    },

    botao1: {
        padding: 2,
        width: '34%',
        marginLeft: 10,
    },



    botao3: {
        backgroundColor: 'rgb(41, 135, 7)',
        padding: 10,
        marginHorizontal: 100,
        borderRadius: 20,
    },

});
